import React from 'react'

const NotFound = () => {
    return (
        <div className='not-found-container'>
            <h1>404</h1>
            <h4>Trang này không tồn tại</h4>
            <button className='btn btn-primary'>Trở lại trang chủ</button> 
        </div>
    )
}

export default NotFound
